string = input("Enter a string: ").lower()

frequency_dict = {}

for char in string:
    if char.isalpha():
        if char in frequency_dict:
            frequency_dict[char] += 1
        else:
            frequency_dict[char] = 1

sorted_dict = sorted(frequency_dict.items())

for key, value in sorted_dict:
    print(key.upper(), value)
